import useSWR from 'swr'
import axios from '../axiosConfig'

const fetcher = async path => {
  const res = await axios.get(path)
  console.log('res', res)
  // console.log('fetcher json', json)
  // return json
  return res.data
}

const Home = () => {
  const { data, error } = useSWR('/api/entries', fetcher)
  console.log(data)
  if (!data) {
    return null
  }
  return <h2>{`Hello ${data.name}`}</h2>
}

export default Home
